Job Description:
Ameresco, Inc. (NYSE:AMRC) is a leading cleantech integrator and renewable energy asset developer, owner and operator. Our comprehensive portfolio includes energy efficiency, infrastructure upgrades, asset sustainability and renewable energy solutions delivered to clients throughout North America and Europe. Our solutions range from upgrades to facility’s energy infrastructure to the development, construction and operation of renewable energy plants combined with tailored financial solutions. We foster an entrepreneurial, collaborative, and forward-thinking culture that thrives with innovation, diversity of thought, and inclusion. We are excited with all that the future holds for our industry, planet, and communities.
Ameresco has a new opportunity for a Data Analyst. This is an entry-level position, maximizing green energy production, reporting to the Remote Operations Control (ROC) Center Manager working in Ameresco’s Operations & Maintenance Group located in Pink Brook, NJ.
Responsibilities:
Monitor real-time control center operations and the performance of solar power plants across the US;
Dispatch field and emergency service personnel when appropriate;
Justify and document technical decisions related to data analysis;
Meeting pre-established solar skill sets through continuous training, courses and certifications;
Assist in preparing written reports, presentation materials, and other project deliverables; and
Perform other duties as needed.
Minimum Qualifications:
BS/BA in Business Analytics, Management Information Systems, related field or the equivalent relevant work experience.
Availability and willingness to work 2 weekend shifts a month.
Preferred Additional Qualifications:
Strong analytical and quantitative skills.
Ability to work well independent with limited oversight.
Demonstrated strong analytical, problem-solving, and decision-making capabilities;
Proficiency in Microsoft Excel, Word, and PowerPoint;
Demonstrated attention to detail and dedication to deliverable quality;
Demonstrated excellence in both verbal and written communication;
Team player with the ability to work in a fast-paced environment across multiple groups;
AMERESCO challenges the brightest, most talented and creative individuals in the industry by providing an environment that embraces initiative, diversity, and achievement along with comprehensive rewards, including people-oriented insurance, investment, and incentive plans.
Equal Opportunity/Affirmative Action Employer/Women/Minorities/Veteran/Disability.
